import { Navigate, useRoutes } from 'react-router-dom';
// auth
import AuthGuard from '../auth/AuthGuard';
import GuestGuard from '../auth/GuestGuard';
// layouts
import CompactLayout from '../layouts/compact';
import DashboardEPLayout from '../layouts/dashboardEP';
// config
import { PATH_EP_DASHBOARD } from './paths';
//
import { Page404, PageOne, PageTwo, PageSix, PageFour, PageFive, LoginPage, PageThree, RegisterPage, EPPageOne, EPPageTwo, EPPageThree, EPPageFour, EPPageFive } from './elements';

// ----------------------------------------------------------------------

export default function Router() {
  return useRoutes([
    {
      path: '/',
      children: [
        { element: <Navigate to={PATH_EP_DASHBOARD.epone} replace />, index: true },
        {
          path: 'login',
          element: (
            <GuestGuard>
              <LoginPage />
            </GuestGuard>
          ),
        },
        { 
          path: 'register', 
          element: 
          <GuestGuard>
          <RegisterPage /> 
          </GuestGuard>
        }
      ],
    },
    {
      path: '/epdashboard',
      element: (
        <AuthGuard>
          <DashboardEPLayout />
        </AuthGuard>
      ),
      children: [
        { element: <Navigate to={PATH_EP_DASHBOARD.epone} replace />, index: true },
        { path: 'pone', element: <EPPageOne /> },
        { path: 'eptwo', element: <EPPageTwo /> },
        { path: 'epthree', element: <EPPageThree /> },
        { path: 'epfour', element: <EPPageFour /> },
        { path: 'epfive', element: <EPPageFive /> }
      ],
    },
    {
      element: <CompactLayout />,
      children: [{ path: '404', element: <Page404 /> }],
    },
    { path: '*', element: <Navigate to="/404" replace /> }
  ]);
}
